import React from "react";
import Netflix from "./Netflix"
import  data from  "./Array"

function App(){
    return(
        <>
        <h1 className="heading"> Lisyt of top 5 Netflix series in 2022</h1>
            
        <Netflix srcimg={data[0].src} 
                 link={data[0].plink}
                 title={data[0].htitle}/>
        
        <Netflix srcimg={data[1].src} 
                 link={data[1].plink}
                 title={data[1].htitle}/>
           <Netflix srcimg={data[2].src} 
                 link={data[2].plink}
                 title={data[2].htitle}/>
                    <Netflix srcimg={data[3].src} 
                 link={data[3].plink}
                 title={data[3].htitle}/>
                    <Netflix srcimg={data[4].src} 
                 link={data[4].plink}
                 title={data[4].htitle}/>
                    <Netflix srcimg={data[5].src} 
                 link={data[5].plink}
                 title={data[5].htitle}/>
        
        
        
        
       
        </>
    )
}
export default App;
